/**
 * Assets for the Showtime Picker widget.
 */
export interface ShowtimePickerAssets {
    /**
     * The name of the icon asset to display when no cinemas have been selected to display showtimes for.
     */
    noSitesSelectedIconName: string;
    /**
     * The name of the icon asset to display when the are no showtimes to display for the current selections.
     */
    noShowtimesIconName: string;
    /**
     * The name of the icon asset to display when an API error occurs.
     */
    failedToLoadDataIconName: string;
}
/**
 * Default assets for the Showtime Picker widget.
 */
export declare const defaultShowtimePickerAssets: ShowtimePickerAssets;
